import React from 'react';
import './App.css';
import CarouselMenu from './components/CarouselMenu';

function App() {
  return (
    <div className="App">
      {/* Header (optional) */}
      <header className="App-header">
        <h1>ApplicationManager</h1>
      </header>

      {/* Hauptinhalt mit Weltraum-Hintergrund */}
      <main className="main-content" style={styles.spaceBackground}>
        <CarouselMenu />
      </main>
    </div>
  );
}

// Stile für den Weltraum-Effekt
const styles = {
  spaceBackground: {
    background: 'radial-gradient(ellipse at center, #0a0e24 0%, #000000 100%)',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    color: 'white'
  }
};

export default App;
